import './App.css';
import { QueryClientProvider, QueryClient} from 'react-query';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import {Negocios} from './pages/Negocios';
import {Negocio} from './pages/Negocio';


const queryClient = new QueryClient()


function App() {
  return (
    <QueryClientProvider client={queryClient}>
      <Router>
      <nav className="bg-slate-500 py-8 mb-8 items-end">
        <Link className="text-2xl px-2" to="/"> Home </Link>


      </nav>
      <h1 className="bg-red-400 text-4xl font-bold justify-center">Productos y Servicios</h1>
      <Routes>
        <Route path="/" element={<Negocios />} />
        <Route path="/:negocioId" element={<Negocio/>}/>
      </Routes>
      <div> Foooter </div>
    </Router>

      </QueryClientProvider>
  );
}

export default App;
